- input: TEXT,F3XA,,"The Alexandria Democratic Committee has no paid employees.  The
    printing costs paid to the Democratic Party of Virginia are at market value.  The
    staff are mostly volunteer and the quality of the product is limited.  Although
    the Jefferson Jackson Dinner was noted as a joint activity in H2 it has been decided
    it would be paid for with only federal money.  The H2 notations could not be deleted.
    As requested in March 8, 2006 letter to the committee the following amendments
    have been made to the report.  Payments to Democratic Party of Virginia for printing
    in the amounts of $121.41 and 12.53 and to U.S.Print and Copy for $399.00 have
    been notated as not  being connected with a federal candidate.  The deposit for
    JJ dinner has also been notated to indicate the dinner was not connected with
    a federal candidate.  The many ratios on H2 have been amended to show revisions
    to clarify that the zero ratio is correct for this report. The donation of CWA-COPE
    has been moved to line 11(c)."
